import { Stack, Button, TextField, FormControl, InputLabel } from '@mui/material'
import React, { useState } from 'react'
import { useNavigate } from 'react-router'

function UnitColumnsHeader() {

  const navigate = useNavigate();

  const [manualOverride, setManualOverride] = useState()

  return (
    <Stack gap={2}>
        <Button variant='contained' sx={{bgcolor: '#328CC1'}} onClick={() => {navigate("/")}}>Home</Button>
        <FormControl variant="standard" >
            <InputLabel shrink sx={{color: 'white'}}>Manual Override</InputLabel>
            <TextField label=" " variant="standard" 
            inputProps={{style: {textAlign: 'center', color: 'white'}}} 
            type="number" InputLabelProps={{shrink: false}}/>
        </FormControl>
    </Stack>
  )
}

export default UnitColumnsHeader
